import React from 'react';
import PropTypes from 'prop-types';
import HeaderDes from './HeaderDes';
import HeaderSearch from './HeaderSearch';

Header.propTypes = {};

function Header(props) {
  return (
    <div className='header'>
      <HeaderDes />
      <HeaderSearch />
    </div>
  );
}

export default Header;
